    false,nt"url": null,nt"notes": "This report addresses the procedures used
    to obtain sediment data, how they analyzed the data, and the potential restoration
    alternatives for Lake Andes. The purpose of this report is to present sediment survey
    information on the south unit of Lake Andes. This information was acquired between
    the dates of February 1 and 25, 1993. This survey was initiated as part of the Lake
    Assessment Project in order to assess the current distribution of the sediment,
    water depth variation, and lake volumetric calculations for sediment and water.",nt"owner_org":
